    <style>

      html {
        font-family: 'Apercu Pro', helvetica, arial, sans-serif;
        color: #000;
      }

      .overflow {
        border: 3px dashed red;
        position: relative; }
      .overflow h1,
      .overflow h2,
      .overflow h3,
      .overflow h4,
      .overflow h5,
      .overflow h6,
      .overflow p,
      .overflow li { color: red !important; }
      .overflow::before {
        content: ‘+’;
        position: absolute;
        z-index: 5;
        top: 5x;   
        right: 5px;   
        height: 55px;   
        width: 55px;    
        border: 1px solid red;
        color: red;
        padding: 2px 2px 2px 3px;
        box-sizing: border-box;
        font-size: 40px;   
        text-align: center;
        line-height: 8px;
        background-color: white;
        text-align: center; }
      .overflow:hover:before {
        background-color: red;
        color: white; }
      .overflow:after {
        display: none; }
      .overflow:hover:after {
        display: block;
        content: ‘There is overset content in this column. Please remove it’;
        position: absolute;
        top: 65px;  
        right: 5px;
        background-color: black;
        color: white;
        border-radius: 2px;
        padding: 5px;
        box-sizing: border-box;
        font-size: 40px;   
        font-weight: 400;
        line-height: 1.1em;
        text-align: right;
        width: 15em;
      }

      .placeholder {
        position: absolute;
        top: 3mm;
        left: 3mm;
        right: 3mm;
        bottom: 3mm;
        background-image: url(https://outfit-v2-exports-production.s3-accelerate.amazonaws.com/media_library_items/2e6655cde8ff265172807fc3e1209d10/FASS.jpeg);
        background-size: cover;
        background-repeat: no-repeat;
        background-position: center;
        z-index: 100;
        pointer-events: none;
        opacity: 0.3;
        display: none;
      }

      .background-image {
        position: absolute;
        top: 0;
        bottom: 0;
        left: 0;
        right: 0;
        overflow: hidden;
        z-index: -1;
      }

      .background-image div {
        width: auto !important;
        height: auto !important;
        right: 0;
        bottom: 0;
      }        

      .container {
        display: flex;
        padding: 1.096rem 1.255rem;
      }

      .container--left {
        justify-content: flex-start;
      }

      .container--right {
        justify-content: flex-end;
      }

      .cricos {
        position: absolute;
        bottom: 0.842rem;
        left: 0.635rem;
        font-size: 0.159rem;
        color: #fff;
        transform: rotate(-90deg);
        transform-origin: left top;
      }

      .content {
        padding: 0.969rem 0.556rem 0.969rem 1.048rem;
        width: 12.297rem;
        height: 12.900rem;
        background: #e74629;
        clip-path: polygon(0 0, 100% 0, 100% 3.7%, 95.7% 3.7%, 95.7% 4.3%, 100% 4.3%, 100% 100%, 0% 100%, 0% 4.3%, 4.3% 4.3%, 4.3% 3.7%, 0% 3.7%, 0 0);
      }

      h1 {
        font-weight: bold;
      }

      .headline {
        margin-bottom: 0.842rem;
        font-size: 1.463rem;
        font-weight: bold;
        letter-spacing: -0.02rem;
        word-spacing: 0.056rem;
      }

      .subheader {
        margin-bottom: 0.572rem;
        font-size: 0.923rem;
        letter-spacing: -0.027rem;
      }

      .url {
        font-size: 0.667rem;
        letter-spacing: -0.017rem;
        padding-left: 0.032rem;
      }

      .link {
        font-weight: bold;
        letter-spacing: -0.0063rem;
      }

      .logo {
        position: absolute;
        bottom: 0.619rem; 
      }

      .logo__image {
        width: 4.194rem;
      }

      /* ANY OTHER STYLES THAT NEED MUSTACHE.JS CAPABILITIES */

      // Check Overflow function
      function checkHeight(element) {
        for (i = 0 ; i < element.length ; i++ ) {
          var currentElement = element[i];
          var height         = currentElement.offsetHeight;
          var parent         = currentElement.parentNode;
          var parentHeight   = parent.offsetHeight;

          if (height > parentHeight) {
            parent.classList.add('overflow');
          } else {
            parent.classList.remove('overflow');
          }

          if ((currentElement).parentNode.classList.contains('overflow')) {
            document.body.classList.add('overflow-true');
          } else {
            document.body.classList.remove('overflow-true'); 
          }
        }
      }   

      function loop() {
        checkHeight(document.getElementsByClassName('check-overflow'));
      } setInterval(loop, 1000);

        } else {

            el.parentNode.style.bottom = '0';
            el.parentNode.style.width = '100%';
